    const script = document.createElement('script');
    script.src = 'https://mnat261999.github.io/js/vendor/modernizr-3.5.0.min.js';
    script.async = true;
    document.body.appendChild(script);
    return () => {
      document.body.removeChild(script);
    };
  });

  return (
    <DataProvider>
      <Router>
      </Router>
    </DataProvider>

  );
}

export default App;
